import React, { Component } from 'react'

export default class Tour extends Component {
    render() {
        return (
            <article className="tour">
                <div className="img-container">

               <img width="200px" src="https://images.pexels.com/photos/3080300/pexels-photo-3080300.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=500" alt="">
               </img>

                </div>
            </article>
        )
    }
}
